import React from 'react';
import styles from './Friend.module.css'
import { NavLink } from 'react-router-dom';

const Friend = (props) => {
  return (
    <div>
      <img className={styles.avatar} src="https://image.freepik.com/free-vector/_1284-1932.jpg" alt=""/>
      <p>{props.name}</p>
    </div>
  )
}
export default Friend;
